import React, { Component } from 'react';
import './css/Home.css';

export class Home extends Component {

    render() {

        const data = this.props.items.phones.slice(0,3).map((id, brand, model ,price) =>{
            return <div>
            <h6>{id.id} : {brand.brand} : {model.model} :{price.price}</h6>
            </div>
        })
        

        return (
            <div className="home">

                {data}

            </div>

        )
    }
}

export default Home;
